import React from 'react';
import { ThemeProvider } from 'styled-components';
import {AppDiv, theme} from './styled/theme';


function App() {
	return (
    <ThemeProvider theme={theme}>
      <AppDiv></AppDiv>
    </ThemeProvider>
	);
}

export default App;
